import React, { Component } from "react";
import axios from "axios";

class MostFQBenefits extends Component {
  constructor(props) {
    super(props);
    this.state = {
      facilities: [],
    };
  }

  componentDidMount() {
    this.fetchData();
  }

  fetchData = async () => {
    try {
      const response = await axios.get(
        "http://195.210.47.82:8000/facility/main/"
      );
      this.setState({ facilities: response.data });
      console.log(response.data); // Вывод данных в консоль браузера (для отладки)
    } catch (error) {
      console.error("Ошибка при получении данных:", error);
    }
  };

  render() {
    const { facilities } = this.state;

    return (
      <div>
        <h2>Facilities</h2>
        <ul>
          {facilities.map((facility, index) => (
            <li key={index}>
              <strong>Category: </strong>
              {facility.category}
              <br />
              <strong>Programs:</strong>
              <ul>
                {facility.programs.map((program, idx) => (
                  <li key={idx}>{program.title}</li>
                ))}
              </ul>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default MostFQBenefits;
